import React from 'react';
import './TestPage.css'; // CSS 파일 임포트

function TaskLogComponent({ tasks }) {
  const formatDate = (date) => {
    const parsedDate = new Date(date);
    return isNaN(parsedDate) ? 'N/A' : parsedDate.toLocaleString();
  };

  return (
    <div className="task-log">
      <h3>작업 로그</h3>
      <div className="task-log-content">
        <table>
          <thead>
            <tr>
              <th>작업 이름</th>
              <th>로봇 IP</th>
              <th>작업 유형</th>
              <th>상태</th>
              <th>시작 시간</th>
              <th>종료 시간</th>
            </tr>
          </thead>
          <tbody>
            {tasks.length > 0 ? (
              tasks.map((task, index) => (
                <tr key={index}>
                  <td>{task.name}</td>
                  <td>{task.robotIp}</td>
                  <td>{task.taskType}</td>
                  <td>{task.status}</td>
                  <td>{formatDate(task.startTime)}</td>
                  <td>{formatDate(task.endTime)}</td>
                </tr>
              ))
            ) : (
              <tr>
                <td colSpan="6" className="no-data">작업 로그가 없습니다.</td>
              </tr>
            )}
          </tbody>
        </table>
      </div>
    </div>
  );
}

export default TaskLogComponent;
